import { MDBCardImage, MDBCol, MDBRow, MDBTypography } from "mdb-react-ui-kit";
import React from "react";

export default function Tags(props) {
  const { tags, tagText, tagImg, tagKey } = props;

  return (
    <>
      <MDBRow className="tags-container">
        {tags.map((tag) => {
          return (
            <MDBCol key={tag.Id} className="tags-item">
              <MDBCardImage src={tag.IconUrl} />
              <MDBTypography>{tagText}</MDBTypography>
            </MDBCol>
          );
        })}
      </MDBRow>
    </>
  );
}
